Mean::~Mean(){
  //delete stuffs
  for (int i_width = 0 ; i_width < r_size + 1 ; i_width++){
    delete [] qQ_[i_width];
    delete [] qB_[i_width];
    delete [] qS_[i_width];
    delete [] qQ_unCorr_[i_width];
    delete [] qB_unCorr_[i_width];
    delete [] qS_unCorr_[i_width];
    for (int i_length = 0 ; i_length < t_size + 1 ; i_length++){
      delete [] qQB_[i_width][i_length];
      delete [] qQB_unCorr_[i_width][i_length];
      delete [] qBS_[i_width][i_length];
      delete [] qBS_unCorr_[i_width][i_length];
      delete [] qSQ_[i_width][i_length];
      delete [] qSQ_unCorr_[i_width][i_length];
    }
    delete [] qQB_[i_width];
    delete [] qQB_unCorr_[i_width];
    delete [] qBS_[i_width];
    delete [] qBS_unCorr_[i_width];
    delete [] qSQ_[i_width];
    delete [] qSQ_unCorr_[i_width];
  }
  delete[] qQ_;
  delete[] qB_;
  delete[] qS_;
  delete[] qQ_unCorr_;
  delete[] qB_unCorr_;
  delete[] qS_unCorr_;
  delete[] qQB_;
  delete[] qQB_unCorr_;
  delete[] qBS_;
  delete[] qBS_unCorr_;
  delete[] qSQ_;
  delete[] qSQ_unCorr_;

  for(int i_term = 0 ; i_term < N_mean_term ; i_term++){
    delete h_mean_qQ_[i_term];
    delete h_mean_qB_[i_term];
    delete h_mean_qS_[i_term];
    delete h_mean_qQ_unCorr_[i_term];
    delete h_mean_qB_unCorr_[i_term];
    delete h_mean_qS_unCorr_[i_term];
  }

  // for(int i_term = 0 ; i_term < N_mixed_mean_term +6 ; i_term++){
  for(int i_term = 0 ; i_term < N_mixed_mean_term ; i_term++){
    delete h_mixed_mean_q_[i_term];
    delete h_mixed_mean_q_unCorr_[i_term];
  }

  //////////////////////////////
  ////////noErr up to C6////////
  //////////////////////////////
  for(int i_term = 0 ; i_term < N_mean_term_noErr ; i_term++){
    delete h_mean_qB_ref3_[i_term];
    delete h_mean_qB_ref3StPicoEvt_[i_term];

    delete h_mean_qQ_epd_[i_term];
    delete h_mean_qB_epd_[i_term];
    delete h_mean_qS_epd_[i_term];

    //unCorr
    delete h_mean_qB_ref3_unCorr_[i_term];
    delete h_mean_qB_ref3StPicoEvt_unCorr_[i_term];

    delete h_mean_qQ_epd_unCorr_[i_term];
    delete h_mean_qB_epd_unCorr_[i_term];
    delete h_mean_qS_epd_unCorr_[i_term];
  }

  //Too much memory!!
  // //Raw multiplicity distribution
  // delete h3_QB_unCorr;
  // delete h3_BS_unCorr;
  // delete h3_SQ_unCorr;
  for(int i_x = 0 ; i_x < 2 ; i_x++){
    for(int i_y = 0 ; i_y < 2 ; i_y++){
      delete [] qQBS_unCorr_[i_x][i_y];
    }
    delete [] qQBS_unCorr_[i_x];
  }
  delete [] qQBS_unCorr_;
  for(int i_QBS = 0 ; i_QBS < 3+1+7 ; i_QBS++) delete h2_QBS_unCorr_[i_QBS];

  //Too much memory!!
  // //Raw q q-bar distribution for Bootstrap
  // delete [] qpiPM_unCorr_;
  // delete [] qkPM_unCorr_;
  // delete [] qpPM_unCorr_;
  
  //Too much memory!!
  // for(int i_mult =0 ; i_mult < 1000 ; i_mult++){
  //   delete h2_pi_unCorr_[i_mult];
  //   delete h2_k_unCorr_[i_mult];
  //   delete h2_p_unCorr_[i_mult];
  // }

  
}

/////////////////////////////////////////////////////////

void Mean::Init(){//initialize q_rs
  for(int r = 0 ; r < r_size + 1 ; r++){
    for(int s = 0 ; s < s_size + 1 ; s++){
      qQ_[r][s] = 0.;
      qB_[r][s] = 0.;
      qS_[r][s] = 0.;
      qQ_unCorr_[r][s] = 0.;
      qB_unCorr_[r][s] = 0.;
      qS_unCorr_[r][s] = 0.;
      // cout<<Form("Mean::TrackCorr. qQ_[%d][%d] = %1.2f", r, s, qQ_[r][s])<<endl;
      for(int t = 0 ; t < t_size + 1 ; t++){
	qQB_[r][s][t] = 0.;
	qQB_unCorr_[r][s][t] = 0.;
	qBS_[r][s][t] = 0.;
	qBS_unCorr_[r][s][t] = 0.;
	qSQ_[r][s][t] = 0.;
	qSQ_unCorr_[r][s][t] = 0.;
      }
    }
  }

  //Raw multiplicity distribution
  for(int i_x = 0; i_x < 2 ; i_x++){
    for(int i_y = 0; i_y < 2 ; i_y++){
      for(int i_z = 0; i_z < 2 ; i_z++){
	qQBS_unCorr_[i_x][i_y][i_z] = 0.;
      }
    }
  }

  //Too much memory!!
  // //Raw q q-bar distribution for Bootstrap
  // for(int i_qqbar = 0 ; i_qqbar < 2 ; i_qqbar++){
  //   qpiPM_unCorr_[i_qqbar] = 0.;
  //   qkPM_unCorr_[i_qqbar] = 0.;
  //   qpPM_unCorr_[i_qqbar] = 0.;
  // }
}

