/////////////////////////////////////////////////////////

void Mean::Write(const char* outFile){
  TFile *f_out = new TFile(outFile, "RECREATE");
  f_out->cd();
  for(int i = 0 ; i < N_mean_term ; i++){
    h_mean_qQ_[i]->Write();
    h_mean_qB_[i]->Write();
    h_mean_qS_[i]->Write();
  }
  
  // for(int i = 0 ; i < N_mixed_mean_term + 6; i++){
  for(int i = 0 ; i < N_mixed_mean_term ; i++){
    h_mixed_mean_q_[i]->Write();
  }

  f_out->Write();
  f_out->Close();
}

