void Mean::UnCorrWrite(const char* outFile){
  TFile *f_out = new TFile(outFile, "RECREATE");
  f_out->cd();
  for(int i = 0 ; i < N_mean_term ; i++){
    h_mean_qQ_unCorr_[i]->Write();
    h_mean_qB_unCorr_[i]->Write();
    h_mean_qS_unCorr_[i]->Write();
  }
  // for(int i = 0 ; i < N_mixed_mean_term + 6; i++){
  for(int i = 0 ; i < N_mixed_mean_term ; i++){
    h_mixed_mean_q_unCorr_[i]->Write();
  }

  //Too much memory!!
  // //Raw multiplicity distribution
  // h3_QB_unCorr->Write();
  // h3_BS_unCorr->Write();
  // h3_SQ_unCorr->Write();
  for(int i_QBS = 0 ; i_QBS < 3+1+7 ; i_QBS++) h2_QBS_unCorr_[i_QBS]->Write();

  //Too much memory!!
  // //Raw q q-bar distribution for Bootstrap
  // for(int i_mult =0 ; i_mult < 1000 ; i_mult++){
  //   h2_pi_unCorr_[i_mult]->Write();
  //   h2_k_unCorr_[i_mult]->Write();
  //   h2_p_unCorr_[i_mult]->Write();
  // }
  
  f_out->Write();
  f_out->Close();
}

