/////////////////////////////////////////////////////////

void Mean::WriteRefMult3(const char* outFile){
  TFile *f_out = new TFile(outFile, "RECREATE");
  f_out->cd();
  for(int i = 0 ; i < N_mean_term_noErr ; i++){
    h_mean_qB_ref3_[i]->Write();
  }
  f_out->Write();
  f_out->Close();
}

/////////////////////////////////////////////////////////

void Mean::UnCorrWriteRefMult3(const char* outFile){
  TFile *f_out = new TFile(outFile, "RECREATE");
  f_out->cd();
  for(int i = 0 ; i < N_mean_term_noErr ; i++){
    h_mean_qB_ref3_unCorr_[i]->Write();
  }
  f_out->Write();
  f_out->Close();
}

