void Mean::WriteRefMult3StPicoEvt(const char* outFile){
  TFile *f_out = new TFile(outFile, "RECREATE");
  f_out->cd();
  for(int i = 0 ; i < N_mean_term_noErr ; i++){
    h_mean_qB_ref3StPicoEvt_[i]->Write();
  }
  f_out->Write();
  f_out->Close();
}

